import React, { useState } from 'react'
import TodoForm from './components/TodoForm'
function App() {
    const [todos, setTodos] = useState([])
    const addTodo = (todo) => {
        setTodos([...todos, todo])
    }
    return (
        <div>
            <h1>Add Your Task</h1>
            <TodoForm addTodo={addTodo} />
        </div>
    )
}

export default App
